import React, { Component } from 'react';
import './Exportar.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';

const url_local = 'http://localhost:8000/';
const url_remote = 'https://www.test.pressstart.co/dev/whitelabel/api/';
const url_default = url_local;

class Exportar extends Component {

    exportar = () => {
        const usuario = document.getElementById('usuario').value;
        const pass = document.getElementById('password').value;
        //axios.post('http://localhost:8000/api/users/login', {'usuario':usuario, 'password':pass})
        axios.post(url_default + 'users/login', {'usuario':usuario, 'password':pass})
        .then(res => {            
            if(res.data.token !== ''){
                window.localStorage.setItem('token', res.data.token);
                this.props.changeLogin();
            }
        })
        
        /*if(respuesta.data.token != ''){
            this.props.changeLogin();
        }*/
    }
    render() {

        return (

            <div id="index-modulos" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        <div className="card-content">
                            <button className="btn waves-effect waves-light col l12" type="button" onClick={this.login} name="action">Exportar</button>
                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

export default Exportar;
